Sixteen is a story about lost innocence     
and teenage heartache in urban India.       
Meet Anu - Young, intelligent, good         
looking, sensitive, ambitious. Brash,       
bold with lots of attitude. She's almost    
a woman now. In the way she dresses, in     
the way she approaches life. She is aware   
of the effect she has on the men around her.
She has been through breakups (note the     
plural), has flings and wants to be the     
Miss India. So that she can one day rule    
the glamour world.                          


